const AddTest = (props) => {

    const [value,setValue] = useState();

    const handleCheckbox = () => {
        props.addTest(value)
    }

    return (
        <> 
            <form>
                <label > Input</label> 
                <input type="input" value="Bike" onChange={e => {setValue(e.target.value)}}/>
                <input type="submit" value="Submit"  onClick={handleCheckbox}/>
            </form>
        </>
    )
}

export default AddTest
